import './App.css';
import {useEffect,useState} from "react";

function App() {
  const [error, setError] = useState(null);
  const [isLoaded, setIsLoaded] = useState(false);
  const [items, setItems] = useState([]);

  useEffect(() => {
    fetch("https://stg-svc.worldvision.ca/donorservice/api/profile/7ef79d2ac8c64a239f92527261ab333b/donor/children/en/NamedPrivate?svc=464424",
    {mode: 'no-cors' })
      .then(res => res.json())
      .then(
        (result) => {
          console.log(result);
          setIsLoaded(true);
          setItems(result);
        },
        (error) => {
          setIsLoaded(true);
          setError(error);
        }
      )
  }, [])

  if (error) {
    return <div>Error: {error.message}</div>;
  } else if (!isLoaded) {
    return <div>Loading...</div>;
  } else {
    return (
      <ul>

      </ul>
    );
  }
}

export default App;
